import { Link } from "react-router-dom";

const UX = (props) => {
  return (
    <>
      <img className="" src="" alt={"photo" + props.user.name} />
      <h4>{props.user.name}</h4>
      <p>{props.user.description}</p>
    </>
  );
};

export default UX;
